// App.js
import { useState } from "react";
import axios from "axios";

axios.defaults.baseURL = "http://localhost:5000";
// ensure axios sends cookies on cross-origin requests
axios.defaults.withCredentials = true;

function App() {
  const [inputs, setInputs] = useState({
    age: "", gender: "", ap_hi: "", ap_lo: "", cholesterol: "", gluc: "",
    smoke: "", alco: "", bmi: ""
  });
  const [output, setOutput] = useState(null);

  const handleChange = (e) => {
    setInputs({...inputs, [e.target.name]: e.target.value});
  };

  const handleSubmit = async () => {
    try {
      // Convert numeric inputs to numbers where appropriate
      const payload = {
        ...inputs,
        age: inputs.age === "" ? undefined : Number(inputs.age),
        ap_hi: inputs.ap_hi === "" ? undefined : Number(inputs.ap_hi),
        ap_lo: inputs.ap_lo === "" ? undefined : Number(inputs.ap_lo),
        cholesterol: inputs.cholesterol === "" ? undefined : Number(inputs.cholesterol),
        gluc: inputs.gluc === "" ? undefined : Number(inputs.gluc),
        smoke: inputs.smoke === "" ? undefined : Number(inputs.smoke),
        alco: inputs.alco === "" ? undefined : Number(inputs.alco),
        bmi: inputs.bmi === "" ? undefined : Number(inputs.bmi),
        gender: inputs.gender === "" ? undefined : Number(inputs.gender),
      };

      const res = await axios.post("/predict_fit", payload, {
        headers: {"Content-Type": "application/json"},
        withCredentials: true
      });
      setOutput(res.data);
    } catch (err) {
      console.error(err);
      alert("Error fetching prediction. Make sure Flask backend is running and CORS is allowed. Also ensure you have logged in (use Login button).");
    }
  };

  const openLogin = () => {
    // Open login in a new tab ‚Äî this will set the session cookie on the backend origin (localhost:5000)
    window.open("http://localhost:5000/login", "_blank");
    alert("Login tab opened. Complete Google login in that tab, then return here and press Predict again.");
  };

  return (
    <div style={{padding: "20px", fontFamily: "Arial"}}>
      <h1>üíì Heart Attack Risk Prediction</h1>

      <div style={{marginBottom: "10px"}}>
        <button onClick={openLogin} style={{padding: "8px 12px", marginRight: "10px"}}>Login with Google Fit (if not logged in)</button>
        <button onClick={handleSubmit} style={{padding: "8px 12px"}}>Predict</button>
      </div>

      <h3>Enter your details (optional):</h3>
      <div style={{display: "flex", flexWrap: "wrap", gap: "15px", marginBottom: "15px"}}>
        {Object.keys(inputs).map((key) => (
          <div key={key}>
            <label>{key}:</label><br/>
            <input
              type="number"
              name={key}
              value={inputs[key]}
              onChange={handleChange}
              style={{width: "100px", padding: "5px"}}
            />
          </div>
        ))}
      </div>

      {output && (
        <div style={{marginTop: "30px", display: "flex", flexDirection: "column", gap: "20px"}}>
          <div style={{border: "1px solid #ccc", padding: "15px", borderRadius: "10px", backgroundColor: "#f9f9f9"}}>
            <h3>üìä Fit Data</h3>
            {/* Guarding against undefined */}
            <p>Steps (avg/day): {output.fit_data && typeof output.fit_data.avg_steps === "number" ? output.fit_data.avg_steps.toFixed(1) : "‚Äî"}</p>
            <p>Calories (avg/day): {output.fit_data && typeof output.fit_data.avg_calories === "number" ? output.fit_data.avg_calories.toFixed(1) : "‚Äî"}</p>
            <p>Height: {output.fit_data && typeof output.fit_data.height === "number" ? output.fit_data.height.toFixed(2) : "‚Äî"} m</p>
            <p>Weight: {output.fit_data && typeof output.fit_data.weight === "number" ? output.fit_data.weight.toFixed(1) : "‚Äî"} kg</p>
          </div>

          <div style={{border: "1px solid #ccc", padding: "15px", borderRadius: "10px", backgroundColor: "#eef6ff"}}>
            <h3>üìù Manual Input (as used by model)</h3>
            {output.manual_input && Object.entries(output.manual_input).map(([key, value]) => (
              <p key={key}>{key}: {typeof value === "number" ? value.toFixed(2) : String(value)}</p>
            ))}
          </div>

          <div style={{border: "1px solid #ccc", padding: "15px", borderRadius: "10px", backgroundColor: "#ffe6e6"}}>
            <h3>ü©∫ Prediction Result</h3>
            <p>Predicted Class: {output.predicted_class} ({output.predicted_class === 1 ? "High Risk" : "Low Risk"})</p>
            <p>Probability: {(output.probability * 100).toFixed(2)}%</p>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
